import './WeatherToday.css';
import React from 'react';
import Search from './Search';

function WeatherToday(props) {
    return (
        <div>
            <div className="WeatherToday"><span className='currentTemperature'>{Math.round(props.celsius)}</span></div><div className="degree"><a className="celsius" href='/'>C</a><span className="separationBar"> | </span><a className="fahrenheit" href='/'>F</a></div>
            <img className="icon" src="https://ssl.gstatic.com/onebox/weather/64/partly_cloudy.png" alt='Partly Cloudy'/>
            <p className="humidity">Humidity: {props.data.humidity}</p>
            <p className="wind">Wind: {props.data.wind} km/h</p>


        </div>
    );
}


export default WeatherToday;

